description:
Kick Buttowski

SEASON 1. EPISODE 19 : Morning Rush / A Fist Full of Ice Cream.

Morning Rush: Kick's &quot;dog ate my homework&quot; excuse is no longer valid and must complete 2 months full of homework in one night when Oskar actually eats his first copy.

A Fist Full of Ice Cream: Kick has to save his dad's birthday when the ice cream truck breaks down.

Kick Buttowski

SEASON 1. EPISODE 20 (SEASON FINALE) : Frame Story / And... Action!.

Frame Story: Kick's principal threatens to expel him if he pulls one more stunt inside the school. Unfortunately the school janitor decides to frame Kick and Kick must clear his name before it's too late. Kendall and Ronaldo have also appeared in the episode.

And... Action: Kick falls in love with the daredevil stunt double named Scarlett Rosetti. After making her popular, Brianna's favorite TV show was about to be canceled, and Kick has to find a way to get the show back on. (ECA Final)

